import React from 'react';
import API from './Api';

export default class BienesApi extends React.Component {
    handleSubmit = event => {
      event.preventDefault();
  
      API.post(`getRef.do?json={"id":"funRegistroGarantias"}`)
        .then(res => {
          console.log(res);
          console.log(res.data);
        })
    }
  }

  BienesAPI.propTypes = {
    clave: PropTypes.string,
    fideicomiso: PropTypes.number,
  };
